import React from "react";
import classes from "./TopIdBarLeft.module.css"




const TopIdBarLeft = () =>{

return(

<div className={classes.topIdBarLeft}>



<button className={classes.allTickets}> All tickets </button>	

<button className={classes.myTickets}> Created by me </button>

<button className={classes.createTicket}> Create ticket </button>	





</div>

);

}

export default TopIdBarLeft;
